import { Navbar, Nav } from 'react-bootstrap';

import './Nav.css';

class Navs extends Component {
    render() {
        return (
            <>

                <Navbar bg="dark" variant="dark" className="navbar">
                    <Navbar.Brand href="#home">
                        Matador MotorSports
                    {/* <img
                        src="/car.svg"
                        width="30"
                        height="30"
                        className="d-inline-block align-top"
                        alt="Matador MotorSports"
                    /> */}
                    </Navbar.Brand>
                </Navbar>


            </>
        )
    }
}

export default Navs;
